'use strict';

const {FritzingPartsAPIClient} = require('../src');

// test for the lists of fritzing parts
describe('ApiClient getFzps', () => {
  test('Status 200', (done) => {
    FritzingPartsAPIClient.getFzps()
    .then((data) => {
      expect(typeof data).toEqual('object');
      done();
    })
    .catch((err) => {
      done(err);
    });
  });
});

